impl Solution {
    pub fn find_prime_pairs(n: i32) -> Vec<Vec<i32>> {
        fn is_prime(x: i32) -> bool {
            if x <= 1 {
                return false;
            }
            for i in 2..=((x as f64).sqrt() as i32) {
                if x % i == 0 {
                    return false;
                }
            }
            true
        }

        let mut primes = Vec::new();
        for i in 2..=n {
            if is_prime(i) {
                primes.push(i);
            }
        }

        let mut result = Vec::new();
        let mut i = 0;
        let mut j = primes.len() as isize - 1;
        while i <= j {
            let sum = primes[i as usize] + primes[j as usize];
            if sum == n {
                result.push(vec![primes[i as usize], primes[j as usize]]);
                i += 1;
                j -= 1;
            } else if sum < n {
                i += 1;
            } else {
                j -= 1;
            }
        }

        result
    }
}
